import React, {Component} from 'react';
import './App.css';
import {getGryffindor} from './endpoints'

class App extends Component {

  state = {
    students: []
  }

  componentDidMount() {
    fetch(getGryffindor)
      .then(resp => resp.json())
      .then(students => this.setState({ students: students[0].members }))
  }

  render(){
    console.log(this.state);
    return (
      <div id="character-container">
      </div>
    )
  }
}

export default App;
